  false,\n\t\"url\": null,\n\t\"notes\": \"This DVD-ROM contains digital high resolution
  seismic reflection data collected during the USGS SEAX 96004 cruise.The coverage
  is the nearshore of the New York and New Jersey Apex. The seismic-reflection data
  are stored as SEG-Y standard format that can be read and manipulated by most seismic-processing
  software. Much of the information specific to the data are contained in the headers
  of the SEG-Y format files. The file system format is ISO 9660 which can be read
  with DOS, Unix, and MAC operating systems with the appropriate DVD-ROM driver software
  installed. For more information on the seismic surveys see http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=1996-004-FA
  These data are also available via GeoMapApp (http://www.geomapapp.org/) and Virtual
  Ocean ( http://www.virtualocean.org/) earth science exploration and visualization
  applications.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
